import Logo from "./Image";

function NavBar(){
    return(
      <nav class="navbar">
        <ul class="nav-list">
          <li></li>
          <li class="nav-item">
            <a class="nav-link"> Home </a>
          </li>
          <li class="nav-item">
            <a class="nav-link"> About </a>
          </li>
        </ul>
      </nav>
    );
}

export default NavBar
